import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../styles/ProcessPanel.css';
import { FiCpu, FiDatabase, FiZap, FiLayers, FiCheck, FiX, FiUploadCloud, FiFolder, FiPlay, FiLoader } from 'react-icons/fi';

function ProcessPanel({ onProcessComplete, onLoadMetadata, onError }) {
  const [mode, setMode] = useState('directory');
  const [imageDir, setImageDir] = useState('data/raw/coco-val-2017-500');
  const [modelPath, setModelPath] = useState('yolo11m.pt');
  const [metadataPath, setMetadataPath] = useState('data/processed/coco-val-2017-500/metadata.json');
  const [loading, setLoading] = useState(false);
  const [batchId, setBatchId] = useState(null);
  const [lastProcessedCount, setLastProcessedCount] = useState(0);
  const [existingDatasets, setExistingDatasets] = useState([]);

  // Fetch existing datasets on mount
  useEffect(() => {
    const fetchDatasets = async () => {
      try {
        const response = await axios.get('/api/datasets');
        if (response.data.success) {
          setExistingDatasets(response.data.datasets);
        }
      } catch (error) {
        console.log('Could not fetch existing datasets');
      }
    };
    fetchDatasets();
  }, []);

  const handleProcessDirectory = async () => {
    if (!imageDir.trim()) {
      onError('Please enter an image directory path');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post('/api/process-directory', {
        imageDir,
        modelPath
      });

      if (response.data.success) {
        const newBatchId = response.data.batchId;
        const newMetadataPath = `data/processed/${newBatchId}/metadata.json`;
        
        setBatchId(newBatchId);
        setMetadataPath(newMetadataPath);
        setLastProcessedCount(response.data.fileCount);
        
        const metadata = response.data.metadata;
        onProcessComplete(metadata);
        onLoadMetadata(metadata);
      }
    } catch (error) {
      onError(error.response?.data?.error || 'Error processing directory');
    } finally {
      setLoading(false);
    }
  };

  const handleLoadMetadata = async () => {
    if (!metadataPath.trim()) {
      onError('Please enter a metadata file path');
      return;
    }

    setLoading(true);
    try {
      const response = await axios.post('/api/load-metadata', {
        metadataPath
      });

      if (response.data.success) {
        onLoadMetadata(response.data.metadata);
        setLastProcessedCount(response.data.fileCount);
      }
    } catch (error) {
      onError(error.response?.data?.error || 'Error loading metadata');
    } finally {
      setLoading(false);
    }
  };

  const loadExistingDataset = async (dataset) => {
    setMetadataPath(dataset.metadataPath);
    setLoading(true);
    try {
      const response = await axios.post('/api/load-metadata', {
        metadataPath: dataset.metadataPath
      });

      if (response.data.success) {
        onLoadMetadata(response.data.metadata);
        setLastProcessedCount(response.data.fileCount);
      }
    } catch (error) {
      onError(error.response?.data?.error || 'Error loading dataset');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="process-panel-container">
      {/* Technology Comparison Section */}
      <section className="comparison-section">
        <div className="section-header">
          <span className="section-badge">Technology Comparison</span>
          <h2>How Object Detection Has Evolved</h2>
          <p>From keyword-based search to AI-powered visual understanding</p>
        </div>

        <div className="comparison-table-wrapper">
          <table className="comparison-table">
            <thead>
              <tr>
                <th className="feature-col">Feature</th>
                <th className="old-tech">
                  <div className="tech-header">
                    <span className="tech-icon"></span>
                    <span>Traditional Search</span>
                    <span className="tech-era">Pre-2012</span>
                  </div>
                </th>
                <th className="google-tech">
                  <div className="tech-header">
                    <span className="tech-icon"></span>
                    <span>Google Vision</span>
                    <span className="tech-era">Current</span>
                  </div>
                </th>
                <th className="our-tech">
                  <div className="tech-header">
                    <span className="tech-icon"></span>
                    <span>YOLOv11 Search</span>
                    <span className="tech-era">This Project</span>
                  </div>
                </th>
              </tr>
            </thead>
            <tbody>
              <tr>
                <td className="feature-name">
                  <FiCpu className="feature-icon" />
                  Detection Method
                </td>
                <td className="old-tech">
                  <span className="method-badge old">Keyword Matching</span>
                  <p>Relies on manual tags and filenames</p>
                </td>
                <td className="google-tech">
                  <span className="method-badge google">CNN + Cloud API</span>
                  <p>Server-side processing with proprietary models</p>
                </td>
                <td className="our-tech">
                  <span className="method-badge ours">YOLOv11 Real-time</span>
                  <p>Single-shot detection at 640x640 resolution</p>
                </td>
              </tr>
              <tr>
                <td className="feature-name">
                  <FiZap className="feature-icon" />
                  Processing Speed
                </td>
                <td className="old-tech">
                  <div className="speed-indicator slow">
                    <span>~5s</span> per image
                  </div>
                  <p>Manual annotation required</p>
                </td>
                <td className="google-tech">
                  <div className="speed-indicator medium">
                    <span>~1-2s</span> per image
                  </div>
                  <p>Network latency + API overhead</p>
                </td>
                <td className="our-tech">
                  <div className="speed-indicator fast">
                    <span>~25ms</span> per image
                  </div>
                  <p>GPU-accelerated local inference</p>
                </td>
              </tr>
              <tr>
                <td className="feature-name">
                  <FiLayers className="feature-icon" />
                  Object Classes
                </td>
                <td className="old-tech">
                  <span className="count-badge">Limited</span>
                  <p>Only what humans manually tag</p>
                </td>
                <td className="google-tech">
                  <span className="count-badge">10,000+</span>
                  <p>Extensive but requires internet</p>
                </td>
                <td className="our-tech">
                  <span className="count-badge highlight">80 COCO</span>
                  <p>Optimized for common objects</p>
                </td>
              </tr>
              <tr>
                <td className="feature-name">
                  <FiDatabase className="feature-icon" />
                  Data Privacy
                </td>
                <td className="old-tech">
                  <div className="privacy-status neutral">
                    <FiCheck /> Local Storage
                  </div>
                </td>
                <td className="google-tech">
                  <div className="privacy-status warning">
                    <FiX /> Cloud Upload Required
                  </div>
                </td>
                <td className="our-tech">
                  <div className="privacy-status success">
                    <FiCheck /> 100% Offline Capable
                  </div>
                </td>
              </tr>
              <tr>
                <td className="feature-name">
                  <FiCpu className="feature-icon" />
                  Cost Model
                </td>
                <td className="old-tech">
                  <span className="cost-badge">Free</span>
                  <p>But extremely time-consuming</p>
                </td>
                <td className="google-tech">
                  <span className="cost-badge expensive">$1.50/1000 images</span>
                  <p>Pay-per-use API pricing</p>
                </td>
                <td className="our-tech">
                  <span className="cost-badge free">Free Forever</span>
                  <p>Open-source, self-hosted</p>
                </td>
              </tr>
            </tbody>
          </table>
        </div>

        <div className="tech-stats">
          <div className="stat-card">
            <div className="stat-value">40x</div>
            <div className="stat-label">Faster than API calls</div>
          </div>
          <div className="stat-card">
            <div className="stat-value">100%</div>
            <div className="stat-label">Data Privacy</div>
          </div>
          <div className="stat-card">
            <div className="stat-value">80</div>
            <div className="stat-label">Object Classes</div>
          </div>
          <div className="stat-card">
            <div className="stat-value">$0</div>
            <div className="stat-label">Cost per Image</div>
          </div>
        </div>
      </section>

      {/* Main Processing Panel */}
      <section className="process-panel">
        <div className="panel-header">
          <div className="panel-title">
            <FiCpu className="panel-icon" />
            <div>
              <h2>Image Processing Pipeline</h2>
              <p>Run YOLOv11 inference or load existing detection data</p>
            </div>
          </div>
        </div>

        <div className="mode-selector">
          <button
            className={`mode-btn ${mode === 'directory' ? 'active' : ''}`}
            onClick={() => setMode('directory')}
            disabled={loading}
          >
            <FiFolder className="mode-icon" />
            <div className="mode-text">
              <span className="mode-title">Process Directory</span>
              <span className="mode-desc">Run YOLO inference on images</span>
            </div>
          </button>
          <button
            className={`mode-btn ${mode === 'load' ? 'active' : ''}`}
            onClick={() => setMode('load')}
            disabled={loading}
          >
            <FiDatabase className="mode-icon" />
            <div className="mode-text">
              <span className="mode-title">Load Dataset</span>
              <span className="mode-desc">Use existing metadata</span>
            </div>
          </button>
        </div>

        {mode === 'directory' && (
          <div className="mode-content">
            <div className="input-group">
              <label>
                <FiFolder className="input-icon" />
                Image Directory
              </label>
              <div className="input-wrapper">
                <input
                  type="text"
                  value={imageDir}
                  onChange={(e) => setImageDir(e.target.value)}
                  placeholder="data/raw/your-images"
                  disabled={loading}
                />
              </div>
              <span className="input-hint">Relative path from project root</span>
            </div>

            <div className="input-group">
              <label>
                <FiCpu className="input-icon" />
                Model Weights
              </label>
              <div className="input-wrapper">
                <input
                  type="text"
                  value={modelPath}
                  onChange={(e) => setModelPath(e.target.value)}
                  placeholder="yolo11m.pt"
                  disabled={loading}
                />
              </div>
              <span className="input-hint">YOLOv11 model file (.pt)</span>
            </div>

            <button
              className="action-btn primary"
              onClick={handleProcessDirectory}
              disabled={loading}
            >
              {loading ? (
                <>
                  <FiLoader className="spinning" />
                  Processing Images...
                </>
              ) : (
                <>
                  <FiPlay />
                  Start Inference Pipeline
                </>
              )}
            </button>

            {batchId && (
              <div className="success-card">
                <div className="success-header">
                  <FiCheck className="success-icon" />
                  <span>Processing Complete</span>
                </div>
                <div className="success-details">
                  <div className="detail-item">
                    <span className="detail-label">Batch ID</span>
                    <span className="detail-value">{batchId}</span>
                  </div>
                  <div className="detail-item">
                    <span className="detail-label">Images Processed</span>
                    <span className="detail-value highlight">{lastProcessedCount}</span>
                  </div>
                </div>
              </div>
            )}
          </div>
        )}

        {mode === 'load' && (
          <div className="mode-content">
            <div className="input-group">
              <label>
                <FiUploadCloud className="input-icon" />
                Metadata File Path
              </label>
              <div className="input-wrapper">
                <input
                  type="text"
                  value={metadataPath}
                  onChange={(e) => setMetadataPath(e.target.value)}
                  placeholder="data/processed/dataset/metadata.json"
                  disabled={loading}
                />
              </div>
              <span className="input-hint">Path to metadata.json file</span>
            </div>

            <button
              className="action-btn primary"
              onClick={handleLoadMetadata}
              disabled={loading}
            >
              {loading ? (
                <>
                  <FiLoader className="spinning" />
                  Loading Dataset...
                </>
              ) : (
                <>
                  <FiDatabase />
                  Load Metadata
                </>
              )}
            </button>

            {lastProcessedCount > 0 && mode === 'load' && (
              <div className="success-card">
                <div className="success-header">
                  <FiCheck className="success-icon" />
                  <span>Dataset Loaded</span>
                </div>
                <div className="success-details">
                  <div className="detail-item">
                    <span className="detail-label">Total Images</span>
                    <span className="detail-value highlight">{lastProcessedCount}</span>
                  </div>
                  <div className="detail-item">
                    <span className="detail-label">Source</span>
                    <span className="detail-value">{metadataPath.split('/').pop()}</span>
                  </div>
                </div>
              </div>
            )}
          </div>
        )}
      </section>

      {/* Architecture Overview */}
      <section className="architecture-section">
        <div className="section-header">
          <span className="section-badge">System Architecture</span>
          <h2>How It Works</h2>
        </div>
        
        <div className="pipeline-flow">
          <div className="pipeline-step">
            <div className="step-number">1</div>
            <div className="step-content">
              <h4>Image Input</h4>
              <p>Upload images or point to a directory</p>
            </div>
          </div>
          <div className="pipeline-arrow"></div>
          <div className="pipeline-step">
            <div className="step-number">2</div>
            <div className="step-content">
              <h4>YOLOv11 Inference</h4>
              <p>Real-time object detection</p>
            </div>
          </div>
          <div className="pipeline-arrow"></div>
          <div className="pipeline-step">
            <div className="step-number">3</div>
            <div className="step-content">
              <h4>Metadata Storage</h4>
              <p>JSON-based detection index</p>
            </div>
          </div>
          <div className="pipeline-arrow"></div>
          <div className="pipeline-step">
            <div className="step-number">4</div>
            <div className="step-content">
              <h4>Semantic Search</h4>
              <p>Query by object class</p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default ProcessPanel;
